import React from "react";
import SimpleImageSlider from "react-simple-image-slider";
import windowDimensions from '../Global/useWindowDimensions';

const VideosPost = (data) => {

    const { height, width } = windowDimensions();
    const [images] = React.useState([
        { id: 1, url: "/images/ahmed1.jpg", name: "Macline" },
        { id: 2, url: "/images/ahsan1.jpg", name: "ahsan32" },
        { id: 3, url: "/images/babar1.jpg", name: "babar42" },
        { id: 4, url: "/images/fawad1.jpg", name: "fawad2" },
        { id: 5, url: "/images/feroz1.jpg", name: "feroz432" },
        { id: 6, url: "/images/0.jfif", name: "adil5" },
        { id: 7, url: "/images/imrankhan1.jpg", name: "imran4" },
        { id: 8, url: "/images/imrankhan3.jpg", name: "khan4" },
        { id: 9, url: "/images/imrankhanpost.jpg", name: "alikhan4" },
    ]);

    return (
        <>
            <div class="chat-block user-content-area">
                <div className="container-fluid">
                    <div className="row">
                        {images.map((items, index) => {
                            return (
                                <div style={{ paddingLeft: 0, paddingRight: 0 }} className="col-sm-4 innerBox">
                                    <div style={{ margin: 2 }} className="imagebox">
                                        <div style={{ position: 'absolute', right: 10, top: 10 }} className="outerBox">
                                            <img className="iconImg" style={{ width: 15, height: 15 }} src={items.url} />
                                        </div>
                                        <div class="chat-video">
                                            <div class="video-frame">
                                                <video class="frame-vedio-control" controls src="images/post-video.mp4" type="video/mp4"></video>
                                            </div>
                                            <div class="video-play-btn"></div>
                                        </div>
                                        <img src={items.url} style={{ width: width / 3 + 160, height: height / 4.6, objectFit: 'cover', borderRadius: 15, marginTop: 4 }} />
                                    </div>
                                </div>
                            )
                        }
                        )}
                    </div>
                </div>
            </div>
        </>
    )
}

export default VideosPost;


